import './App.css';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import RootComponent from './components/RootComponent';
function App() {
  return (
    <div className="App">
      <Router>
          <Switch>
            <Route exact path="/" component={RootComponent} />
            </Switch>
            </Router>

    </div>
  );
}

export default App;
